import Vue from "vue";
import MTextFieldVue from "./m-text-field";
import MTextareaVue from "./m-textarea";
import MDatePickerVue from "./m-date-picker";
import MSelectVue from "./m-select.vue";

Vue.component("m-text-field", MTextFieldVue);
Vue.component("m-textarea", MTextareaVue);
Vue.component("m-date-picker", MDatePickerVue);
Vue.component("m-select", MSelectVue);
